      CSD U1 Lesson 5 Overview:
        markdown: |-
          # Преглед

          Во оваа лекција ќе научите за различните типови на влезни и излезни уреди што ги користат компјутерите и видовите на информации што ги испраќаат и примаат.

          ## Вокабулар

          * ** Влез ** - Уред или компонента што дозволува давање информации на компјутер
          * ** Излез ** - Секој уред или компонента што прима информации од компјутер


